package components.curve.fitting;

import components.curve.composedGraph.ComposedGraphInterface;
import components.observableshapes.ObservablePointInterface;

public class Plotter {
	private ComposedGraphInterface graph;
	private FittingProcessorInterface fitter = new FittingProcessor();
	
	public Plotter(ComposedGraphInterface aGraph) {
		graph = aGraph;
	}
	
	public void plot() {
		int planeX = graph.getPlane().getX();
		int planeY = graph.getPlane().getY();
		double xScale = (graph.getPlane().getXMax() - graph.getPlane().getXMin()) / graph.getPlane().Y_LENGTH;
		for (ObservablePointInterface point : graph.getPoints()) {
			fitter.addFittingPoint((point.getX() - planeX)* graph.getPlane().getXMax(), y);
		}
	}
}

